import React from 'react';
import SectionContainer from './styled/SectionContainer.styled';
import SectionMainHeading from './styled/SectionMainHeading.styled';
import SectionSubHeading from './styled/SectionSubHeading.styled';
import ArticleCard from './styled/ArticleCard.styled';
import Paragraph from './styled/Paragraph.styled';
import TopicLabelsContainer from './styled/TopicLabelsContainer.styled';
import TopicLabel from './styled/TopicLabel.styled';

const OtherProjects = () => {
  return (
    <SectionContainer bg>
      <SectionMainHeading>Other Projects</SectionMainHeading>
      <ArticleCard other>
        <SectionSubHeading>Hej</SectionSubHeading>
        <Paragraph>Hej hej</Paragraph>
        <TopicLabelsContainer>
        <TopicLabel>Hej hej hej</TopicLabel>
        </TopicLabelsContainer>
      </ArticleCard>
    </SectionContainer>
  );
};

export default OtherProjects;
